{"$content":[{"ID":"char_h0157_003_dialog_english##_00_000","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_embarrass","IconLocate":2,"Text":"Darnit, all these Panther houses look the same...","sfxName":"h0157sx_story_004","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_00_001","SpeakerName":"Panther Thug","SpeakerAssetName":"CharacterName/t0048c3","IconName":"t0048c3_normal","IconLocate":2,"Text":"Why's it smell like dirty humans? Hey!","sfxName":"human_male_young_royal_12_ver1","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_01_000","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_happiness","IconLocate":2,"Text":"Wonderful! Are you here to take me to the matriarch?","sfxName":"h0157sx_story_015_ver1","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_01_001","SpeakerName":"Panther Thug","SpeakerAssetName":"CharacterName/t0048c3","IconName":"t0048c3_normal","IconLocate":2,"Text":"Eh? Do we look like stupid idiots? Open your eyes dumb broad, before you get yourself hurt!","sfxName":"human_male_young_royal_12_ver2","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_01_002","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_embarrass","IconLocate":2,"Text":"...Uh, is there something I can help you with?","sfxName":"h0157sx_story_005_ver2","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_02_000","SpeakerName":"Panther Mafioso","SpeakerAssetName":"CharacterName/t3338c3","IconName":"t3338c3_normal","IconLocate":2,"Text":"Heard you want to join the East Alliance Martial Arts Tourney and you came here to borrow something of ours.","sfxName":"human_male_middle_soldier_11","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_02_001","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_happiness","IconLocate":2,"Text":"That's right. I'll win for sure.","sfxName":"h0157sx_story_003","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_03_000","SpeakerName":"Panther Thug","SpeakerAssetName":"CharacterName/t0048c3","IconName":"t0048c3_normal","IconLocate":2,"Text":"Hahaha, good joke. Whatta ya say, boss?","sfxName":"human_male_young_royal_05_ver2","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_04_000","SpeakerName":"Panther Mafioso","SpeakerAssetName":"CharacterName/t3338c3","IconName":"t3338c3_normal","IconLocate":2,"Text":"Haha, very funny.","sfxName":"human_male_middle_soldier_04","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_05_000","SpeakerName":"Panther Mafioso","SpeakerAssetName":"CharacterName/t3338c3","IconName":"t3338c3_normal","IconLocate":2,"Text":"A mere human, beating beasts? Quit dreaming! If you don't want something bad to happen, you best leave now!","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_06_000","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_sadness","IconLocate":2,"Text":"I almost forgot there were beasts like you...","sfxName":"h0157sx_story_029","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_06_001","SpeakerName":"Panther Thug","SpeakerAssetName":"CharacterName/t0048c3","IconName":"t0048c3_normal","IconLocate":2,"Text":"Huh? What'd you say?","sfxName":"human_male_young_royal_13_ver2","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_07_000","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_serious","IconLocate":2,"Text":"I am Miranda, disciple of Law, Grandmaster of the Wolf Tribe.

I formally challenge you to determine who's skills reign supreme. Remember, this is not a fight to the death.","sfxName":"h0157sx_select_01","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_07_001","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_happiness","IconLocate":2,"Text":"An injury may be difficult to prevent...so if you're scared, you may refuse.","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_08_000","SpeakerName":"Panther Mafioso","SpeakerAssetName":"CharacterName/t3338c3","IconName":"t3338c3_normal","IconLocate":2,"Text":"You think I'm scared of you, ya rotten human!","sfxName":"human_male_middle_soldier_13","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_09_000","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_serious","IconLocate":2,"Text":"The winner has been decided. That was a good fight!","sfxName":"h0157s4_victory_01","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_09_001","SpeakerName":"Panther Thug","SpeakerAssetName":"CharacterName/t0048c3","IconName":"t0048c3_normal","IconLocate":2,"Text":"Waaaaahhh!","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_10_000","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_anger","IconLocate":2,"Text":"If Master didn't always remind me to control my temper...","sfxName":"h0157sx_story_029","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_10_001","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_anger","IconLocate":2,"Text":"I'd teach these discriminating beasts a lesson for sure, I would!","sfxName":"h0157sx_story_001","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_11_000","SpeakerName":"Fatima","SpeakerAssetName":"CharacterName/t0026","IconName":"t0026s5_serious","IconLocate":2,"Text":"...For a human, you're quite skilled.","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_11_001","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"Yes...","sfxName":"human_female_old_03","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_12_000","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_surprise","IconLocate":2,"Text":"Miss Matriarch, what did you find?","sfxName":"h0157sx_story_005_ver2","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_12_001","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"...Aigh, Fatima. Grandmother is thirsty.","sfxName":"human_female_old_01_ver1","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_13_000","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"This human is Me...me what?","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_13_001","SpeakerName":"Fatima","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_embarrass","IconLocate":2,"Text":"Miranda.","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_13_002","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"Ah, yes~ Now I remember.","sfxName":"human_female_old_01_ver1","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_14_000","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"This young damsel named Miranny, what she speaks is true.","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_14_001","SpeakerName":"Fatima","SpeakerAssetName":"CharacterName/t0026","IconName":"t0026s5_surprise","IconLocate":2,"Text":"......","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_14_002","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"The ancient manuscripts record that each of the major tribes in the East Alliance possessed a wooden tablet. 

Made from the Udumbara tree, it contained abundant spiritual energy allowing it to exist without rotting.","sfxName":"human_female_old_03","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_14_003","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"Later, the Panther tribe split it in two, one residing in the East Alliance and the Holy Talisman residing here with us.","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_14_004","SpeakerName":"Panther Officer","SpeakerAssetName":"CharacterName/t3182c3","IconName":"t3182c3_normal","IconLocate":2,"Text":"But Ancestral Mother, I've never heard of such a thing.","sfxName":"beastmen_female_other_young_03","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_14_005","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"The manuscripts state that this is because...um...","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_15_000","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"...Let Grandmother see...","sfxName":"human_female_old_03","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_16_000","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"Ah, yes. Our ancestors took the Holy Talisman to the mountains to symbolize the Panther God that we worship, sealing it there.","sfxName":"human_female_old_04","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_16_001","SpeakerName":"Panther Officer","SpeakerAssetName":"CharacterName/t3182c3","IconName":"t3182c3_normal","IconLocate":2,"Text":"Ah, the forbidden area behind the mountain.","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_16_002","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"Indeed. Before, the ancestors would perform ceremonies there regularly.","sfxName":"human_female_old_01_ver1","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_16_003","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"Afterwards, things got better for the tribe and everybody began to forget. Before long...no one even remembered where it came from.","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_16_004","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_nervous","IconLocate":2,"Text":"Um, so can you give it to me?","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_17_000","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"I suppose since we don't use it, we could lend it to you...","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_17_001","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"But the ancient manuscripts indicate that if a Panther warrior wants to bear the Holy Talisman they must pass...a test.","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_17_002","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_surprise","IconLocate":2,"Text":"A test? What kind of test?","sfxName":"h0157sx_story_005_ver2","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_17_003","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"Hmm...there was no description. I am not sure...","sfxName":"human_female_old_03","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_17_004","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"What do you think? Shall we let this young one try?","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_17_005","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_happiness","IconLocate":2,"Text":"Yeah! I need this to compete. Of course I gotta take the test!","sfxName":"h0157sx_story_003","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_18_000","SpeakerName":"Panther Officer","SpeakerAssetName":"CharacterName/t3182c3","IconName":"t3182c3_normal","IconLocate":2,"Text":"Matriarch, humans cannot be trusted.","sfxName":"beastmen_female_other_young_03","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_18_001","SpeakerName":"Panther Officer","SpeakerAssetName":"CharacterName/t3182c3","IconName":"t3182c3_normal","IconLocate":2,"Text":"If her master comes and can testify to her words, she still will have time to make it.","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_18_002","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"Makes sense...Fatima, what do you think?","sfxName":"human_female_old_03","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_18_003","SpeakerName":"Fatima","SpeakerAssetName":"CharacterName/t0026","IconName":"t0026s5_serious","IconLocate":2,"Text":"......","sfxName":"","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_19_000","SpeakerName":"Miranda","SpeakerAssetName":"CharacterName/h0157","IconName":"h0157s4_happiness","IconLocate":2,"Text":"I understand. I shall await my master's return.","sfxName":"h0157sx_story_003","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_19_001","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"Wonderful, dear child. Just a few days wait.","sfxName":"human_female_old_06","sfxVolume":1.0},{"ID":"char_h0157_003_dialog_english##_19_002","SpeakerName":"Mother Liukanee","SpeakerAssetName":"CharacterName/t3339c4","IconName":"t3339c4_normal","IconLocate":2,"Text":"Ah, yes. What...What did you say your name was again?","sfxName":"human_female_old_05","sfxVolume":1.0}]}
